<!DOCTYPE html>
<html lang="en">

<head>
    <title>misha</title>
    <meta charset="utf-8">
    <link rel="shortcut icon" href="favicon.ico">
    <style>
        * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
        }

        :root {
            --font-family: 'Mono', monospace;

            --color-terminal: hsl(265, 60%, 6%);
            ;
            --color-foreground: #CC99FF;
            --color-background: #220B31;
            --color-cursor: #d0d0d0;
            --color-selection: rgba(204, 153, 255, 0.25);
            --color-header-line: hsl(265, 60%, 22%);

            --color-green: #478061;
            --color-cyan: #51E1E9;
            --color-blue: #54B6F8;

            --blink-speed: 1s;
        }

        body {
            background-color: var(--color-background);
            color: var(--color-foreground);
            font-family: var(--font-family);
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
        }

        .terminal {
            background-color: var(--color-terminal);
            border-radius: 8px;
            width: 600px;
            max-width: 90%;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.7);
            overflow: hidden;
            position: relative;
        }

        .terminal-header {
            background-color: var(--color-terminal);
            padding: 10px;
            display: flex;
            align-items: center;
            justify-content: center;
            border-bottom: 1px solid var(--color-header-line);
            font-style: italic;
        }

        .terminal-title {
            color: var(--color-foreground);
            font-size: 14px;
            font-weight: bold;
        }

        .terminal-content {
            padding: 20px;
            position: relative;
        }

        .prompt-line {
            display: flex;
            align-items: center;
            margin-bottom: 4px;
        }

        .prompt-left {
            display: flex;
            gap: 5px;
        }

        .prompt {
            color: var(--color-green);
        }

        .command {
            color: var(--color-blue);
        }

        .input {
            color: var(--color-cyan);
        }

        .output {
            color: var(--color-foreground);
        }

        .prompt-content {
            margin-left: 10px;
        }

        .cursor {
            display: inline-block;
            width: 8px;
            height: 16px;
            background-color: var(--color-cursor);
            margin-left: 13px;
            animation: blink 1.1s infinite;
            vertical-align: bottom;
        }

        @keyframes blink {
            0% {
                opacity: 1;
            }

            50% {
                opacity: 0;
            }

            100% {
                opacity: 1;
            }
        }

        .terminal-icons {
            position: absolute;
            bottom: 10px;
            right: 10px;
            display: flex;
            gap: 10px;
        }

        .terminal-icons a {
            color: var(--color-foreground);
            text-decoration: none;
        }

        .terminal-icons svg {
            width: 20px;
            height: 20px;
            fill: var(--color-foreground);
        }

        @media (max-width: 600px) {
            .terminal-content {
                padding: 15px;
            }

            .terminal-icons {
                bottom: 15px;
                right: 15px;
            }
        }
    </style>
</head>
